L'Inps, con circolare n. 25 dell'11.2.2022, comunica le seguenti informazioni relative alle quote, al valore minimale e al valore massimale del reddito erogato per il calcolo dei contributi dovuti da tutti i soggetti iscritti alla Gestione separata di cui all'articolo 2, comma 26, della legge 335 del 1995:

*   Quote: 0,8% del reddito netto totale;
*   Valore minimo: 0,8% del reddito netto totale;
*   Valore massimo: 1,2% del reddito netto totale.
